style.css:
@-moz-document url("http://www.f5oclock.com/") {
body {
    background-color: rgba(0, 0, 0, 0.9);
    /*dark gray*/
}
tr {
    color: rgb(255, 255, 255);
    /*white*/
}
a {
    color: rgb(0, 169, 155);
    /*teal*/
}
a:visited {
    color: rgb(174, 210, 207);
    /*light teal*/
}
.trending {
    background-color: rgba(255, 255, 255, 0.75)!important;
    /*barely white*/
    color: black;
}
.hot {
    background-color: rgba(255, 255, 255, 0.85)!important;
    /*almost white*/
    color: black;
}
.f5oclock {
    background-color: rgba(255, 255, 255, 0.95)!important;
    /*white*/
    color: black;
}
footer {
    display: none;
}
}
